if (seed != null) {
	try {
		InputStream inputStream = seed.getInputStream();
		rnd.setSeed(FileCopyUtils.copyToByteArray(inputStream));
	}
	catch (Exception ex) {
		throw new IllegalArgumentException("Failed to read seed resource [" + seed + "]", ex);
	}
}

